import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Chat from './Chat'
function App() {
  return (
    <Router>
      <div>
        <h1>Hello, React Router!</h1>
        <Routes>
          <Route path="/" element={<Chat />} />
        </Routes>
      </div>
    </Router>
  );
}


export default App;
